// src/components/CreateTaskModal.js
import React, { useState } from 'react';
import { createTask } from '../services/api';

const initialFormState = { summary: '', description: '', status: 'To Do', priority: 'Medium', assigneeId: '' };

const CreateTaskModal = ({ isOpen, onClose, onTaskCreated, projectKey, statuses, projectMembers }) => {
    const [form, setForm] = useState(initialFormState);
    const [isSaving, setIsSaving] = useState(false);

    if (!isOpen) return null;

    const handleChange = (e) => {
        setForm({ ...form, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setIsSaving(true);
        try {
            const response = await createTask(projectKey, form);
            onTaskCreated(response.data);
            setForm(initialFormState);
            onClose();
        } catch (error) {
            console.error("Failed to create task:", error);
        } finally {
            setIsSaving(false);
        }
    };

    return (
        <div style={styles.modalOverlay} onClick={onClose}>
            <form style={styles.modalContent} onClick={(e) => e.stopPropagation()} onSubmit={handleSubmit}>
                <h3 style={styles.header}>Create New Task in {projectKey}</h3>
                
                <label style={styles.label}>Summary</label>
                <input style={styles.input} name="summary" value={form.summary} onChange={handleChange} required />

                <label style={styles.label}>Description</label>
                <textarea style={styles.textarea} name="description" value={form.description} onChange={handleChange} />

                <label style={styles.label}>Status</label>
                <select style={styles.input} name="status" value={form.status} onChange={handleChange}>
                    {(statuses || []).map(s => <option key={s} value={s}>{s}</option>)}
                </select>

                <label style={styles.label}>Assignee</label>
                <select style={styles.input} name="assigneeId" value={form.assigneeId} onChange={handleChange}>
                    <option value="">Unassigned</option>
                    {(projectMembers || []).map(member => (
                         <option key={member.id} value={member.id}>{member.name} ({member.role})</option>
                    ))}
                </select>

                <label style={styles.label}>Priority</label>
                <select style={styles.input} name="priority" value={form.priority} onChange={handleChange}>
                    {['High', 'Medium', 'Low'].map(p => <option key={p} value={p}>{p}</option>)}
                </select>
                
                <button style={styles.submitButton} type="submit" disabled={isSaving}>
                    {isSaving ? 'Creating...' : 'Create Task'}
                </button>
            </form>
        </div>
    );
};

const styles = {
    modalOverlay: { position: 'fixed', top: 0, left: 0, right: 0, bottom: 0, backgroundColor: 'rgba(0,0,0,0.5)', display: 'flex', justifyContent: 'center', alignItems: 'center', zIndex: 1000 },
    modalContent: { backgroundColor: 'white', padding: '30px', borderRadius: '5px', width: '600px', maxHeight: '90vh', overflowY: 'auto', position: 'relative' },
    header: { marginBottom: '20px' },
    label: { display: 'block', margin: '10px 0 5px', fontWeight: 'bold', fontSize: '13px' },
    input: { width: '100%', padding: '8px', marginBottom: '10px', border: '1px solid #ccc', borderRadius: '3px', boxSizing: 'border-box' },
    textarea: { width: '100%', height: '100px', padding: '8px', marginBottom: '10px', border: '1px solid #ccc', borderRadius: '3px', boxSizing: 'border-box' },
    submitButton: { padding: '10px 15px', backgroundColor: '#0052cc', color: 'white', border: 'none', borderRadius: '3px', cursor: 'pointer', marginTop: '15px' }
};

export default CreateTaskModal;
